import { View } from 'react-native';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 


const Tabs = ({height}) =>{
    return(

        <View style={{height:height, width:"100%", backgroundColor:"red", position:"absolute", bottom:0, display:'flex', alignItems:'center', justifyContent:'center', flexDirection:'row'}}>


                <View style={{height:"100%",width:"35%", justifyContent:'flex-start', alignItems:'center', backgroundColor:"green", paddingBottom:2}}>
                    <MaterialCommunityIcons name="table-furniture" size={50} color="white" />
                </View>



        </View>

        )
}

export default Tabs;
